import React from "react";

class EditFishForm extends React.Component {
  render() {
    return <p>Edit Fish</p>;
    <div className="fish-edit">
      <input name="name" value={this.props.fish.name} type="text" placeholder="Name" />
      <input name="price" value={this.props.fish.price} type="text" placeholder="Price" />
      <select name="status" value={this.props.fish.status} >
        <option value="available">Fresh!</option>
        <option value="unavailable">Sold Out!</option>
      </select>
      <textarea name="description" value={this.props.fish.description} placeholder="Description" />
      <input name="image" value={this.props.fish.image} type="text" placeholder="Image" />
    </div>
  }
}

export default EditFishForm;
